import './App.css';
import { useEffect } from 'react';
import { animate } from 'animejs';

function App() {
  useEffect(() => {
    animate('.zeronia-text text', {
      strokeDashoffset: [1000, 0],
      easing: 'inOut(sine)',
      duration: 2500,
      delay: 500
    });

    animate('.zeronia-text text', {
      fill: ['rgba(192, 49, 22, 0)', 'rgba(192, 49, 22, 1)'],
      easing: 'inOut(quad)',
      duration: 1500,
      delay: 2000
    });
  }, []);

  return (
    <div className="App">
      <svg className="zeronia-text" viewBox="0 0 600 120" xmlns="http://www.w3.org/2000/svg">
        <text x="50%" y="50%" dominantBaseline="middle" textAnchor="middle">
          ZERONIA
        </text>
      </svg>
    </div>
  );
}

export default App;
